import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import About from './pages/About'; // Import your page component

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/about" component={About} />
            </Switch>
        </Router>
    );
};

export default App;
